  Grid,
  Image,
  Dimmer,
  Loader,
  Segment,
  Placeholder,
} from "semantic-ui-react";

export default function FavoriteArtistContainer({ myFavoriteArtists }) {
  console.log(myFavoriteArtists);
  return (
    <div>
      <Grid stackable columns={1} doubling>
        <Grid.Column>
          <Placeholder>
            <Placeholder.Header image>
              <Placeholder.Line />
              <Placeholder.Line />
            </Placeholder.Header>
            <Placeholder.Paragraph>
              <Placeholder.Line />
              <Placeholder.Line />
              <Placeholder.Line />
              <Placeholder.Line />
            </Placeholder.Paragraph>
          </Placeholder>
        </Grid.Column>
      </Grid>
      <Grid stackable columns={4} doubling>
        {/* 
      {myFavoriteArtists &&
        myFavoriteArtists.map((artist) => {
          return <FavoriteArtistCard artist={artist} />;
        })} */}
      </Grid>
    </div>
  );
}
